import {
	Card,
	CardActionArea,
	CardActions,
	CardContent,
	CardMedia,
	Typography,
	Button,
} from "@mui/material";
import * as React from "react";

export default function Cart(props) {
	const { products, onAdd } = props;
	return (
		<div>
			<h2>Products</h2>

			<div>
				{products.map((product) => (
					<h3>{product.name}</h3>
				))}
			</div>
		</div>
	);
}
